import React, { useState } from "react";
import { connect } from "react-redux";
import tracks from "./results/trackData";

function Fullstack(props) {
  const [selectedTrack, setSelectedTrack] = useState("fullstack");

  return (
    <div className="w-1/3 border">
      <h2>{tracks[selectedTrack].name}</h2>
      <p>tracks[selectedTrack].description</p>
    </div>
  );
}
const mapStateToProps = state => {
  return {};
};
export default connect(mapStateToProps, {})(Fullstack);
